import logo from './logo.svg';
import './App.css';
import books from './book-database.json'

function App() {
  return (
    <div className="App">
      {books.map(book => (
        <div class="Book-title" key={book.title}>{book.title}</div>
      ))}
    </div>
  );
}

export default App;
